           $(\'meta[name=\\\"_csrf_header\\\"]\').attr(\'content\', arr[1].trim());\\n              $(\'meta[name=\\\"_csrf\\\"]\').attr(\'content\', arr[2].trim());\\n            }\\n          }\\n          request.post(form.action, $(form).serializeJSON()).then(function (response) {\\n            var data = response.data;\\n            if (data.status === 0) {\\n              displayAlert(\'投票成功\');\\n              $(\'#voteForm\')[0].reset();\\n            } else if (data.message) {\\n              displayAlert(data.message);\\n              $(\'#voteForm\')[0].reset();\\n            }\\n          });\\n        });\\n      }\\n    });\\n  </script>\\n\\n  <h5 class=\\\"mt-3 ml-2\\\">\\n    <i class=\\\"fas fa-tags text-primary\\\"></i> <a href=\\\"${dy}/tag\\\" class=\\\"text-reset text-decoration-none\\\">Tags</a>\\n  </h5>\\n  <div class=\\\"px-3\\\">\\n    [@TagList limit=\'10\';list]\\n    [#list list as bean]\\n    <a href=\\\"${dy}/tag/${bean.id?c}\\\" class=\\\"btn btn-secondary btn-sm btn-sm mt-2 ml-2\\\">${bean.name}</a>\\n    [/#list]\\n    [/@TagList]\\n  </div>\\n\\n</div>\\n[/#escape]\\n\"\n}','{\"headers\":{},\"body\":{\"status\":0,\"result\":null,\"message\":null,\"exception\":null},\"statusCode\":\"OK\",\"statusCodeValue\":200}',NULL),(1054,'http://47.98.40.141:8080/api/backend/core/channel','[ 139 ]','{\"headers\":{},\"body\":{\"status\":0,\"result\":null,\"message\":null,\"exception\":null},\"statusCode\":\"OK\",\"statusCodeValue\":200}',NULL),(1055,'http://47.98.40.141:8080/api/backend/core/channel','{\n  \"id\" : 4,\n  \"siteId\" : 1,\n  \"channelModelId\" : 12,\n  \"articleModelId\" : 11,\n  \"name\" : \"新闻\",\n  \"alias\" : \"news\",\n  \"type\" : 1,\n  \"articleTemplate\" : \"article\",\n  \"channelTemplate\" : \"channel\",\n  \"targetBlank\" : false,\n  \"nav\" : true,\n  \"pageSize\" : 10,\n  \"orderDesc\" : true,\n  \"allowComment\" : true,\n  \"allowContribute\" : true,\n  \"allowSearch\" : true,\n  \"created\" : \"2023-06-07T09:02:59Z\