\"文物博物馆\",\n    \"url\" : \"\"\n  },\n  \"channel\" : {\n    \"id\" : 8,\n    \"articleModelId\" : 11,\n    \"name\" : \"国内\",\n    \"nav\" : true,\n    \"orderDesc\" : true,\n    \"paths\" : [ {\n      \"id\" : 8,\n      \"name\" : \"国内\",\n      \"url\" : \"/channel/\"\n    } ],\n    \"url\" : \"/channel/\"\n  },\n  \"org\" : {\n    \"id\" : 1,\n    \"name\" : \"总部\"\n  },\n  \"user\" : {\n    \"id\" : 1,\n    \"username\" : \"admin\"\n  },\n  \"modifiedUser\" : {\n    \"id\" : 1,\n    \"username\" : \"admin\"\n  },\n  \"blockItemList\" : [ ],\n  \"destList\" : [ ],\n  \"tagNames\" : [ ],\n  \"text\" : \"<p>2022年俄勒冈田径世锦赛第二比赛日争夺&#xff0c;男子跳远王嘉男一鸣惊人&#xff0c;凭借最后一跳的惊人表现&#xff0c;跳出8米36的成绩&#xff0c;实现逆袭获得冠军&#xff0c;这也是中国男子跳远历史上首枚世锦赛金牌。其余出战各项目资格赛的中国选手许双双、陆佳雯谢文骏均无缘晋级。波兰名将法伊德克在男子链球项目上完成世锦赛五连冠&#xff1b;女子10000米埃塞俄比亚选手吉迪拿到金牌。</p>\\n<p>男子跳远决赛&#xff0c;王嘉男第一跳就发挥出色7米94&#xff0c;第三跳跃出8米03升至第五。直至最后一跳&#xff0c;王嘉男才调整到最佳状态&#xff0c;拼尽全力奋力一跃&#xff0c;加速起跳充分&#xff0c;成绩有效达到8米36&#xff0c;实现逆袭获得冠军。东京奥运冠军&#xff0c;希腊选手坦托格鲁以8米32的成绩获得亚军&#xff0c;瑞士的艾哈迈尔8米16拿到铜牌。</p>\\n<p>女子100米预赛&#xff0c;葛曼棋、梁小静携手出战&#xff0c;三年前的多哈世锦赛&#xff0c;两人都止步半决赛。梁小静和葛曼棋&#xff0c;分别以11秒25和11秒17排名各自小组第五。预赛总排名&#xff0c;葛曼棋成为小组第三之外的三个最好成绩之一&#xff0c;压哨进入半决赛。英国选手史密斯10秒84排名第一&#xff0c;牙买加名将弗雷泽跑出10秒87紧随其后。</p>\\n<p>男子110米栏预赛&#xff0c;带伤出战的谢文骏以13秒577完赛&#xff0c;仅落后以小q晋级的西班牙人洛皮斯0.004秒&#xff0c;位列总第25无缘晋级半决赛。女子跳高资格赛&#xff0c;首次参加世锦赛的小将陆佳雯尝试1.81米的横杆三次失败&#xff0c;最终以1米75的成绩排名小组第14无缘决赛。女子3000米障碍预赛&#xff0c;许双双跑出9分39秒17的成绩&#xff0c;总排名第32无缘决赛。</p>\\n<p>男子链球决赛&#xff0c;波兰选手包揽冠亚军&#xff0c;法伊德克以81米98的成绩完成该项目五连冠&#xff0c;沃伊切赫-诺维茨基81米03获得亚军&#xff0c;挪威选手亨里克森80米87排名第三。</p>\\n<p>女子10000米&#xff0c;埃塞俄比亚的吉迪以30分09秒94的成绩夺冠&#xff0c;弥补上届屈居亚军的遗憾。肯尼双姝奥比里和基普肯博伊&#xff0c;分别以30分10秒02和30分10秒07分获亚军和季军。</p>\",\n  \"normal\" : true,\n  \"link\" : false,\n  \"image\" : \"https://img.dpm.org.cn/Uploads/Picture/2016/12/16/s58535685318b3.png\",\n  \"title\" : \"王嘉男8米36逆袭摘金 中国跳远首次夺冠\",\n  \"ups\" : 0,\n  \"downs\" : 0,\n  \"downloads\" : 0,\n  \"comments\" : 0,\n  \"dynamicUrl\" : \"/article/105\",\n  \"targetBlank\" : false,\n  \"plainText\" : \"2022年俄勒冈田径世锦赛第二比赛日争夺，男子跳远王嘉男一鸣惊人，凭借最后一跳的惊人表现，跳出8米36的成绩，实现逆袭获得冠军，这也是中国男子跳远历史上首枚世锦赛金牌。其余出战各项目资格赛的中国选手许双双、陆佳雯谢文骏均无缘晋级。波兰名将法伊德克在男子链球项目上完成世锦赛五连冠；女子10000米埃塞俄比亚选手吉迪拿到金牌。 男子跳远决赛，王嘉男第一跳就发挥出色7米94，第三跳跃出8米03升至第五。直至最后一跳，王嘉男才调整到最佳状态，拼尽全力奋力一跃，加速起跳充分，成绩有效达到8米36，实现逆袭获得冠军。东京奥运冠军，希腊选手坦托格鲁以8米32的成绩获得亚军，瑞士的艾哈迈尔8米16拿到铜牌。 女子100米预赛，葛曼棋、梁小静携手出战，三年前的多哈世锦赛，两人都止步半决赛。梁小静和葛曼棋，分别以11秒25和11秒17排名各自小组第五。预赛总排名，葛曼棋成为小组第三之外的三个最好成绩之一，压哨进入半决赛。英国选手史密斯10秒84排名第一，牙买加名将弗雷泽跑出10秒87紧随其后。 男子110米栏预赛，带伤出战的谢文骏以13秒577完赛，仅落后以小q晋级的西班牙人洛皮斯0.004秒，位列总第25无缘晋级半决赛。女子跳高资格赛，首次参加世锦赛的小将陆佳雯尝试1.81米的横杆三次失败，最终以1米75的成绩排名小组第14无缘决赛。女子3000米障碍预赛，许双双跑出9分39秒17的成绩，总排名第32无缘决赛。 男子链球决赛，波兰选手包揽冠亚军，法伊德克以81米98的成绩完成该项目五连冠，沃伊切赫-诺维茨基81米03获得亚军，挪威选手亨里克森80米87排名第三。 女子10000米，埃塞俄比亚的吉迪以30分09秒94的成绩夺冠，弥补上届屈居亚军的遗憾。肯尼双姝奥比里和基普肯博伊，分别以30分10秒02和30分10秒07分获亚军和季军。\",\n  \"fileSize\" : \"0 KB\",\n  \"blocks\" : [ ],\n  \"editable\" : true,\n  \"allowComment\" : true,\n  \"baiduPush\" : false,\n  \"editorType\" : 1,\n  \"favorites\" : 0,\n  \"dayViews\" : 0,\n  \"weekViews\" : 0,\n  \"monthViews\" : 0,\n  \"quarterViews\" : 0,\n  \"yearViews\" : 0,\n  \"views\" : 16,\n  \"description\" : \"2022年俄勒冈田径世锦赛第二比赛日争夺，男子跳远王嘉男一鸣惊人，凭借最后一跳的惊人表现，跳出8米36的成绩，实现逆袭获得冠军，这也是中国男子跳远历史上首枚世锦赛金牌。其余出战各项目资格赛的中国选手许双双、陆佳雯谢文骏均无缘晋级。波兰名将法伊德克在男子链球项目上完成世锦赛五连冠；女子10000米埃塞俄比亚选手吉迪拿到金牌。 男子跳远决赛，王嘉男第一跳就发挥出色7米94，第三跳跃出8米03升至第五。直至最后一跳，王嘉男才调整到最佳状态，拼尽全力奋力一跃，加速起跳充分，成绩有效达到8米36，实现逆袭获得冠军。东京奥运冠军，希腊选手\",\n  \"url\" : \"/article/105\",\n  \"tags\" : [ ]\n}','{\"headers\":{},\"body\":{\"status\":0,\"result\":null,\"message\":null,\"exception\":null},\"statusCode\":\"OK\",\"statusCodeValue\":200}',NULL),(1123,'http://47.98.40.141:8080/api/backend/core/channel','{\n  \"id\" : 4,\n  \"siteId\" : 1,\n  \"channelModelId\" : 12,\n  \"articleModelId\" : 11,\n  \"name\" : \"新闻\",\n  \"alias\" : \"news\",\n  \"type\" : 1,\n  \"articleTemplate\" : \"article\",\n  \"channelTemplate\" : \"channel_GG\",\n  \"targetBlank\" : false,\n  \"nav\" : true,\n  \"pageSize\" : 10,\n  \"orderDesc\" : true,\n  \"allowCo