INSERT INTO `ujcms_survey` VALUES (1,1,'用户体验及满意度调查',NULL,NULL,NULL,'2023-08-08 16:49:25','2023-08-08 16:49:25',1,0,0,'1'),(51,1,'南方供暖已成各界共识，你对江西供暖怎么看？','近年来，每逢供暖期，呼吁“南方集中供暖”的话题都会成为热点。清华大学建筑节能研究中心的调研报告显示，并非所有南方城市有供暖需求，真正需要的是国家划定的“夏热冬冷”地区，包括上海、重庆、湖北、湖南、安徽、江西、江苏、浙江、四川等。这些省份冬季室温远低于北方城市集中供热时的室内温度。你对江西供暖怎么看？',NULL,NULL,'2023-08-08 16:56:07','2023-08-08 16:56:07',1,0,0,'1');
